;; **
;;; It's easy to map data in Clojure onto R data.frames so that they can be plotted. Data should be given as a map, with each key representing a column, and each value a seq of data.
;; **

;; @@
(def xs (range 0 10 1))
(def ys (map #(Math/sin %) xs))
(def dat {:x xs :y ys})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/dat</span>","value":"#'gg4clj.demo/dat"}
;; <=

;; **
;;; The helper function `gg4clj/data-frame` will transform a map in the appropriate format to an R data.frame call. To issue it to R, we build a list of commands, the first assigns the data.frame to a variable, `d`, and the second plots it.
;; **

;; @@
(gg4clj/view
  [[:<- :d (gg4clj/data-frame dat)]
   [:qplot :x :y {:data :d :geom [:c "point" "line"]}]])
